import {Login} from './Login'
import {Signup} from './Signup'
import {Recovery} from './Recovery'

// Image
import fImage from '../../Image/Groupe1.png'


export const Register = () => {

    function Child() {
       // Nous  utilisons le hook `useParams` ici pour accéder l'URL
        let { id } = useParams();
        if (id === "Login" )
        return (
          <div>
            <h3>ID: {id}</h3>
          </div>
        );
      }

    return(
        <Main>
            <Recovery/>
        </Main>
    )
}
